import React from 'react';
import './App.css';

export default class App extends React.Component {
  state = {
    add: 'add',
    listp: [{ addText: 'add' }, { delText: 'x' }],
  };

  render() {
    const styles = {
      border: '3px solid black',
      width: '300px',
      height: '25px',
      marginTop: '20px',
    };
    const addStyle = {
      height: '31px',
      border: '3px solid black',
      width: '50px',
    };
    const pstyle = {
      height: '25px',
      width: '300px',
    };
    const { add } = this.state;
    return (
      <div className='App'>
        <div className='btn'>
          <input type='text' style={styles}></input>
          <button style={addStyle}>{add}</button>
        </div>
        <div className='list'>
          <p style={pstyle}>
            <span>{this.state.addText}</span>
          </p>
        </div>
      </div>
    );
  }
}
